import * as React from "react";
import {Box, Paper} from "@mui/material";
import profile from "../data/profile";


const DataBlock = (props) => {
  return (
    <Box
      sx={{
        display: 'flex',
        flexWrap: 'wrap',
        '& > :not(style)': {
          m: 2,
          width: 400,
          height: 500,
        },
      }}
    >
      <Paper elevation={3} ></Paper>
    </Box>
  );
}
export default function Home() {
  return(
    <DataBlock></DataBlock>
  )
}
